import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent implements OnInit {

  public eventos: any = [];
  widthImg: number = 150;
  marginImg: number = 2;
  exibirImg: boolean = true;
  private _filtroLista: string = '';

  public get filtroLista(): string {
    return this._filtroLista;
  }

  public set filtroLista(value: string) {
     this._filtroLista = value;
     this.eventos = this.filtroLista ? this.filtrarEventos(this.filtroLista) : this.eventos;
  }

  filtrarEventos(filtrarPor: string): any {
    filtrarPor = filtrarPor.toLocaleLowerCase();
    return this.eventos.filter(
      evento => evento.tema.toLocaleLowerCase().indexOf
    )
  }

  constructor(private http: HttpClient) { }

  ngOnInit(): void {
    this.getEventos();
  }

  alterarImg() {
    this.exibirImg = !this.exibirImg;
  }
  public getEventos(): void {
    this.http.get('https://localhost:5001/api/eventos').subscribe(
      response => this.eventos = response,
      error => console.log(error)
    );
    
  }
}
<h2>Eventos</h2>
<hr>

<div class="form-inline">
    <div class="form-group mb-2">
        <input type="text" 
        class="form-control mr-2" 
        paceholder="buscar"
        [(ngModel)]="filtroLista"
        >
        <button class="btn btn-outline-success">Buscar</button>
    </div>
</div>

<h3>Filtro: {{filtroLista}}</h3>
<table class="table table-striped">
<thead class="thead-dark">
    <tr *ngIf="eventos && eventos.length">
        <th>
            <button type="button" class="btn btn-outline-light" (click)="alterarImg()">
                {{!exibirImg ? 'exibir' : 'ocultar'}}
            </button>
        </th>
        <th>#</th>
        <th>Tema</th>
        <th>Local</th>
        <th>Data</th>
        <th>Qtd Pessoas</th>
        <th>Lote</th>
    </tr>
</thead>
<tbody *ngIf="eventos && eventos.length">
        <tr *ngFor="let evento of eventos">  
            <td>
                <img [collapse]="!exibirImg" [isAnimated]="true" src="/assets/{{evento.imagemURL}}"
                [style.width.px]="widthImg"
                [style.margin.px]="marginImg">
            </td>
            <td>{{evento.eventoId}}</td>
            <td>{{evento.tema}}</td>
            <td>{{evento.local}}</td>
            <td>{{evento.dataEvento}}</td>
            <td>{{evento.qtdPessoas}}</td>
            <td>{{evento.lote}}</td>
        </tr>
</tbody>
<tfoot *ngIf="!eventos.length">
    <tr>
        <td colspan="8" class="text-center">
            <h4>Nenhum evento encontrado!</h4>
        </td>
    </tr>
</tfoot>
</table>
